import React from 'react';
import { useState, useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { decrement, incrementByAmount } from './counter';
import Yearlyamount from './Yearlyamount';
import Monthlyaddons from './Monthlyaddons';
export default function Addons(monthlyAdd) {
  return (
    <>
      <div className="content">
        <div className="content-text">
          <h1>Select your plan</h1>
          <p>You have the option of monthly or yearly billing</p>
        </div>
        <Monthlyaddons key={monthlyAdd.id} {...monthlyAdd}></Monthlyaddons>
      </div>
    </>
  );
}
